import React, { useState } from 'react';
import { useNavigate, Link } from 'react-router-dom'; // Import useNavigate from react-router-dom

function LoginPage() {
  const [isLogin, setIsLogin] = useState(true); // Toggle between login and signup
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const navigate = useNavigate(); // Initialize the navigate hook

  const handleSubmit = (event) => {
    event.preventDefault();
    if (isLogin) {
      console.log('Email:', email);
      console.log('Password:', password);
      navigate('/CustomerLandingPage'); // Redirect to the homepage
    } else {
      console.log('Signing up with', email);
      navigate('/'); // Redirect to the homepage after signup
    }
  };

  const handleToggle = () => {
    setIsLogin(!isLogin);
    if (!isLogin) {
      navigate('/signup');
    }
  };

  return (
    <>
      <header className="header">
        <div className="width">
          <Link to="/" className="logo">
            <h1>Smart Homes</h1>
          </Link>
        </div>
        <nav>
          <ul>
            <li><Link to="/" className="nav-link">Home</Link></li>
            <li><Link to="/products/doorbells" className="nav-link">Smart Doorbell</Link></li>
            <li><Link to="/products/doorlocks" className="nav-link">Smart Doorlock</Link></li>
            <li><Link to="/products/lighting" className="nav-link">Smart Lighting</Link></li>
            <li><Link to="/products/speakers" className="nav-link">Smart Speaker</Link></li>
            <li><Link to="/products/thermostats" className="nav-link">Smart Thermostat</Link></li>
          </ul>
        </nav>
        <div className="header-icons">
          <div className="login-menu">
            <span className="login-icon">Login</span>
          </div>
        </div>
      </header>
      <div className="login-page">
        <div className="login-box">
          <section id="content">
            <h2>{isLogin ? 'Login' : 'Sign Up'}</h2>
            <form onSubmit={handleSubmit}>
              <div className="form-group">
                <label htmlFor="email">Email:</label>
                <input
                  type="email"
                  id="email"
                  value={email}
                  onChange={(e) => setEmail(e.target.value)}
                  required
                />
              </div>
              <div className="form-group">
                <label htmlFor="password">Password:</label>
                <input
                  type="password"
                  id="password"
                  value={password}
                  onChange={(e) => setPassword(e.target.value)}
                  required
                />
              </div>
              <button type="submit">{isLogin ? 'Login' : 'Sign Up'}</button>
            </form>
            <p>
              {isLogin ? "Don't have an account?" : 'Already have an account?'}
              <button onClick={handleToggle}>
                {isLogin ? 'Sign Up' : 'Login'}
              </button>
            </p>
          </section>
        </div>
      </div>
    </>
  );
}

export default LoginPage;
